import React from 'react';
import Faker from '../node_modules/faker';

let recipies=[];
const size = 10;
for(let i=0;i<size;i++){
    let firstName = Faker.name.firstName();
    recipies.push(firstName);
}

const Home = ()=>{

    let items = recipies.map(item =>{
        <li>{item}</li>
    })
    console.log("Faker : "+items);
    return(
        <div>
            <h1>Recepies</h1>
            <ul>
                {items}
            </ul>
        </div>
    )
}
export default Home;
